import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the modal by clicking the "Shop now" button
    await page.waitForSelector('button.cta-button', { timeout: 5000 });
    await page.click('button.cta-button');

    // Wait for the modal to appear
    await page.waitForSelector('.modal-content', { timeout: 5000 });

    // Press Escape key to close the modal
    await page.keyboard.press('Escape');

    // Verify the modal is closed
    const isModalVisible = await page.isVisible('.modal-content');
    if (!isModalVisible) {
      console.log('Modal closed successfully');
    } else {
      console.log('Modal is still visible');
    }

    // Take screenshot after closing the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_closed.png'));

    return {
      success: true,
      action: "Closed the modal using the Escape key",
      extractedData: { modalClosed: !isModalVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
